const blueTheme = {
	colors: {
		background: '#505050',
		opposite: '#ffffff',

		Primary: '#738E8F',
		Secondary: '#8EBDBF',
		Tertiary: '#95D1D4',
		Quaternary: '#BAE0E2',
		Quinary: '#EFFDFE',
	},
};

export default blueTheme;
